package cn.edu.ncu.bbs.service.Impl;

import cn.edu.ncu.bbs.domain.User;
import cn.edu.ncu.bbs.domain.UserExample;
import cn.edu.ncu.bbs.domain.security.MyToken;
import cn.edu.ncu.bbs.mapper.UserMapper;
import cn.edu.ncu.bbs.mapper.UserRoleMapper;
import cn.edu.ncu.bbs.service.UserRoleService;
import cn.edu.ncu.bbs.service.UserService;
import cn.edu.ncu.bbs.until.FileUtil;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.security.core.context.SecurityContextHolder;
import org.springframework.stereotype.Service;
import org.springframework.web.multipart.MultipartFile;
import sun.plugin.liveconnect.SecurityContextHelper;

import java.sql.Date;
import java.util.List;


@Service
public class UserServiceImpl implements UserService {
    @Autowired
    private UserMapper userMapper;

    @Autowired
    private UserRoleService userRoleService;

    public User findById(String id)
    {
        return userMapper.selectByPrimaryKey(Integer.valueOf(id));
    }


    public Integer userRegister(User user){
        user.setIntegral(30);
        user.setUserIcon("");
        userMapper.insertSelective(user);
        userRoleService.iniPower((long)user.getUserId());
        return user.getUserId();
    }

    public List<User> selectALLExceptSelf(Integer userId){
        UserExample userExample=new UserExample();
        UserExample.Criteria criteria = userExample.createCriteria();
        criteria.andUserIdNotEqualTo(userId);
        List<User> users= userMapper.selectByExample(userExample);
        return users;
    }

    public User selectUserById(Integer userId){
        return  userMapper.selectByPrimaryKey(userId);
    }

    public void deleteUser(Integer userId){
        userMapper.deleteByPrimaryKey(userId);
    }

    public void userChange(User user){
        MyToken myToken=(MyToken) SecurityContextHolder.getContext().getAuthentication();
        userMapper.updateByPrimaryKeySelective(user);
        User newUser=userMapper.selectByPrimaryKey(user.getUserId());
        myToken.setUserName(newUser.getUserName());
        myToken.setPassword(newUser.getPassword());
        myToken.setGender(newUser.getGender());
        myToken.setAge(newUser.getAge());
        myToken.setUserIcon(newUser.getUserIcon());
        myToken.setJob(newUser.getJob());
        myToken.setUserIcon(newUser.getUserIcon());
    }

    public User changeIntegral(String type,Integer userId,Integer changeIntegral){
        User user = selectUserById(userId);
        if("add".equals(type)) {
            user.setIntegral(user.getIntegral() + changeIntegral);
        }
        if("reduce".equals(type)&&user.getIntegral() - changeIntegral>=0) {
            user.setIntegral(user.getIntegral() - changeIntegral);
        }
        userMapper.updateByPrimaryKeySelective(user);
        return   user;
    }

    public List<User> findAll()
    {
        UserExample userExample=new UserExample();
        return userMapper.selectByExample(userExample);
    }
}

